from biosequences.io import SequenceChunkMaker

TRANSCRIPT_ID2QUERY = 'ENSOCUT00000001061'
SEQ_REF = ''

def test_getfromdb():
    aa = SequenceChunkMaker(save_dir='', yield_data=True)
    x = list(aa([TRANSCRIPT_ID2QUERY]))
    assert x[0][0]['n_exons'] == 6
    assert x[0][0]['sequence_id'] == TRANSCRIPT_ID2QUERY
    assert x[0][1] == SEQ_REF

if __name__ == '__main__':
    test_getfromdb()